import React from "react";
import {
  CarouselProvider,
  Slider,
  Slide,
  ButtonBack,
  ButtonNext,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

function ProductImages() {
  return (
    <div>
      <CarouselProvider
        naturalSlideWidth={100}
        naturalSlideHeight={100}
        totalSlides={4}
        dragEnabled={true}
        touchEnabled={true}
        infinite={true}
        visibleSlides={1}
      >
        <Slider>
          <Slide index={0}>
            <div style={{ height: 100, margin: 10, background: "red" }}>
              I am the first Slide.
            </div>
          </Slide>
          <Slide index={1}>
            <div style={{ height: 100, margin: 10, background: "green" }}>
              I am the second Slide.
            </div>
          </Slide>
          <Slide index={2}>
            <div style={{ height: 100, margin: 10, background: "blue" }}>
              I am the third Slide.
            </div>
          </Slide>
          <Slide index={3}>
            <div style={{ height: 100, margin: 10, background: "yellow" }}>
              I am the fourth Slide.
            </div>
          </Slide>
          <Slide index={4}>
            <div style={{ height: 100, margin: 10, background: "orange" }}>
              I am the fifth Slide.
            </div>
          </Slide>
        </Slider>
        <ButtonBack>Back</ButtonBack>
        <ButtonNext>Next</ButtonNext>
      </CarouselProvider>
    </div>
  );
}

export default ProductImages;
